import React from 'react';
import ReactDOM from "react-dom";
//import "./index.css"
const fname="m ansari";
const file="rct program";
const links="https://picsum.photos/200/300";

const first = {
    color: "#fa9191",
    fontFamily: "Verdana, Geneva, Tahoma, sans-serif",
fontSize: "30px",
fontWeight: "bold",
margin: "auto",
textAlign: "center",
borderSpacing: "90",
wordSpacing: "10px"

};

ReactDOM.render(
<>
<h1 className="first">my name is {fname}</h1>
<p className="first">{`this is for ${file} by ${fname}`}</p>
<div >
<img src={links} alt="noavailable"/>
</div>
     <div>
    <p >

    {  `my name is ansari.
        and i want to tell 
         you that you are 
         awesome. feel your
         positive energy and 
        work hard for yourself 
        because you have a family
         to feed not a comunity
          to impress thats is.`
    }</p> 
     </div>


</>,
document.getElementById("root")
);
